import React from 'react';
import { Waves } from './footer.styles';

const Footer = () => {
	return (
		<div className="wave">
			<Waves>
				<div
					style={{ display: 'flex', paddingTop: '20%', justifyContent: 'center', color: 'white' }}
				>
					whats up
				</div>
			</Waves>
		</div>
	);
};

export default Footer;
